import React, { Component } from "react";

class Do extends Component {
  render() {
    return (
      <div>
        <p
          style={{
            color: "blue",
            backgroundColor: "black",
            fontSize: "20px",
            border: "2px solid red",
          }}
        >
          The Doing
        </p>
        <p>siedoflkvs</p>
      </div>
    );
  }
}

export default Do;
